import React, { useState } from "react";

// üîó ÿ±ÿßÿ®ÿ∑ ÿßŸÑŸÄ Backend ÿßŸÑÿ¨ÿØŸäÿØ
const API_BASE = "https://sba-cmms.onrender.com/api";

// üî¢ Normalize Arabic digits to English
const normalizeDigits = (input) => {
  if (!input) return "";
  return input.replace(/[Ÿ†-Ÿ©]/g, (d) => "Ÿ†Ÿ°Ÿ¢Ÿ£Ÿ§Ÿ•Ÿ¶ŸßŸ®Ÿ©".indexOf(d));
};

function Requester() {
  const [form, setForm] = useState({});
  const [customLocation, setCustomLocation] = useState("");
  const [ticketId, setTicketId] = useState(null);
  const [tickets, setTickets] = useState([]);
  const [errorSubmit, setErrorSubmit] = useState(null);
  const [errorTrack, setErrorTrack] = useState(null);
  const [trackPhone, setTrackPhone] = useState("");
  const [tab, setTab] = useState("new");

  const handleChange = (e) => {
    let value = e.target.value;
    if (e.target.name === "contact") {
      value = normalizeDigits(value);
    }
    setForm({ ...form, [e.target.name]: value });
  };

  const submitTicket = async (e) => {
    e.preventDefault();
    setErrorSubmit(null);
    setTicketId(null);

    const payload = {
      ...form,
      location: form.location === "Other" ? customLocation : form.location,
    };

    try {
      const res = await fetch(`${API_BASE}/tickets`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(payload),
      });
      const data = await res.json();
      if (data.ticketId) {
        setTicketId(data.ticketId);
      } else {
        setErrorSubmit("‚ùå ŸÑŸÖ Ÿäÿ™ŸÖ ÿ•ŸÜÿ¥ÿßÿ° ÿßŸÑÿ®ŸÑÿßÿ∫");
      }
    } catch {
      setErrorSubmit("‚ö†Ô∏è ÿÆÿ∑ÿ£ ŸÅŸä ÿßŸÑÿßÿ™ÿµÿßŸÑ ÿ®ÿßŸÑÿÆÿßÿØŸÖ");
    }
  };

  const trackByPhone = async () => {
    setErrorTrack(null);
    setTickets([]);
    try {
      const res = await fetch(`${API_BASE}/tickets?contact=${normalizeDigits(trackPhone)}`);
      const data = await res.json();
      if (data.tickets && data.tickets.length > 0) {
        setTickets(data.tickets);
      } else {
        setErrorTrack("‚ùå ŸÑÿß ÿ™Ÿàÿ¨ÿØ ÿ®ŸÑÿßÿ∫ÿßÿ™ ŸÖÿ±ÿ™ÿ®ÿ∑ÿ© ÿ®Ÿáÿ∞ÿß ÿßŸÑÿ±ŸÇŸÖ");
      }
    } catch {
      setErrorTrack("‚ö†Ô∏è ÿÆÿ∑ÿ£ ŸÅŸä ÿßŸÑÿßÿ™ÿµÿßŸÑ ÿ®ÿßŸÑÿÆÿßÿØŸÖ");
    }
  };

  return (
    <div style={{ padding: 20, direction: "rtl" }}>
      <h2>üìã ÿ•ÿ±ÿ≥ÿßŸÑ ÿ®ŸÑÿßÿ∫ ÿ¨ÿØŸäÿØ</h2>
      <form onSubmit={submitTicket}>
        <input name="title" placeholder="ÿßŸÑÿπŸÜŸàÿßŸÜ" onChange={handleChange} required />
        <textarea name="description" placeholder="ÿßŸÑŸàÿµŸÅ" onChange={handleChange} required />
        <select name="location" onChange={handleChange} required>
          {[...Array(14)].map((_, i) => (
            <option key={i}>Studio {i + 1}</option>
          ))}
          <option value="Other">ÿ£ÿÆÿ±Ÿâ</option>
        </select>
        {form.location === "Other" && (
          <input value={customLocation} onChange={(e) => setCustomLocation(e.target.value)} placeholder="ÿ£ÿØÿÆŸÑ ÿßŸÑŸÖŸàŸÇÿπ" />
        )}
        <input name="contact" placeholder="ÿ±ŸÇŸÖ ÿßŸÑÿ¨ŸàÿßŸÑ" onChange={handleChange} required />
        <button type="submit">üì® ÿ•ÿ±ÿ≥ÿßŸÑ ÿßŸÑÿ®ŸÑÿßÿ∫</button>
      </form>

      {ticketId && <p>‚úÖ ÿ™ŸÖ ÿ•ŸÜÿ¥ÿßÿ° ÿßŸÑÿ™ÿ∞ŸÉÿ±ÿ© ÿ®ŸÜÿ¨ÿßÿ≠: {ticketId}</p>}
      {errorSubmit && <p style={{ color: "red" }}>{errorSubmit}</p>}

      <h3>üîé ŸÖÿ™ÿßÿ®ÿπÿ© ÿ®ŸÑÿßÿ∫ÿßÿ™Ÿä</h3>
      <input value={trackPhone} onChange={(e) => setTrackPhone(e.target.value)} placeholder="ÿ±ŸÇŸÖ ÿßŸÑÿ¨ŸàÿßŸÑ" />
      <button onClick={trackByPhone}>üìÇ ÿπÿ±ÿ∂ ÿßŸÑÿ®ŸÑÿßÿ∫ÿßÿ™</button>
      {errorTrack && <p style={{ color: "red" }}>{errorTrack}</p>}
      {tickets.map((t) => (
        <a key={t.id} href={`/track/${t.id}`} style={{ display: "block" }}>
          {t.id} - {t.status} - {t.location}
        </a>
      ))}
    </div>
  );
}

export default Requester;
